import React from 'react';
import { NavLink } from 'react-router-dom';
//import './navbar.css'; // Import custom CSS for styling

const Navbar=() => {
    return (
        <nav className="navbar">
            <ul className="nav-list">
                <li className="nav-item">
                    <NavLink exact to="/" activeClassName="active" className="nav-link">Home</NavLink>
                </li>
                <li className="nav-item">
                    <NavLink to="/timeline" activeClassName="active" className="nav-link">Timeline</NavLink>
                </li>
                <li className="nav-item">
                    <NavLink to="/friends" activeClassName="active" className="nav-link">Friends</NavLink>
                </li>
                <li className="nav-item">
                    <NavLink to="/about" activeClassName="active" className="nav-link">About</NavLink>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
